import React from "react";
import { Link } from "react-router-dom";
function Home() {
  return (
    <>
          <div className="fullPage ">
              <div className="thoborBackground"></div>
        <div className="banner">
          <h1>Bine ai venit la tresure hunt-ul organizat de Thobor</h1>
        </div>
        <div className="obtiuni">
          <div className="start">
            <h2><Link>Start</Link></h2>
          </div>
          <div className="instructiuni">
            <h2>instructiuni</h2>
          </div>
        </div>
      </div>
    </>
  );
}

export default Home;
